details:
 Wee Care Learning Center...
...is a ministry of St. John's Lutheran Church;

...is a state licensed preschool;

...offers creative learning experiences for children who are three-years-old by September 1 (and toilet trained), through five years of age;

...is open to any child regardless of race, religion, creed or ethnic origin;

...stands by a philosophy that each child who attends the Center will develop, through application of Christian truth, a good self-image and leave liking themselves and others;

...offers a unique Christian curriculum that is reflected in stories, music, and projects;

...helps each child understand that he/she is a precious child of God and helps each child learn about the love of God in Jesus Christ and his forgiveness to all who believe;

...offers developmentally appropriate activities for 3, 4 and 5-year-olds;

...operates from September through May;

...never exceeds a class ratio of one teacher or aide for every ten students;

...has a teaching staff that is fully certified and/or licensed.

Mission Statement
We are committed to being a successful learning community, which includes:
• a partnership with parents and their children;
• a celebration of diversity;
• an atmosphere of support, respect, and trust;
where everyone is safe and experiences a sense of belonging.
